/*
*

	Given a string s, find the length of the longest
	substring

		without repeating characters.

	Example 1:

	Input: s = "abcabcbb"
	Output: 3
	Explanation: The answer is "abc", with the length of 3.
	Example 2:

	Input: s = "bbbbb"
	Output: 1
	Explanation: The answer is "b", with the length of 1.
	Example 3:

	Input: s = "pwwkew"
	Output: 3
	Explanation: The answer is "wke", with the length of 3.
	Notice that the answer must be a substring, "pwke" is a subsequence and not a substring.

	Constraints:

	0 <= s.length <= 5 * 104
	s consists of English letters, digits, symbols and spaces.
*/
func largeSubstringByIndex_NotOptimal(word string, index int, longestWord string) string {
	var helper bytes.Buffer
	var hashTable = make([]bool, 256)
	for i := index; i < len(word); i++ {
		letter := word[i]
		if hashTable[letter] {
			helper.Reset()
			hashTable = make([]bool, 256)
		}
		helper.WriteByte(letter)
		hashTable[letter] = true
		if len(longestWord) < helper.Len() {
			longestWord = helper.String()
		}
	}
	return longestWord
}
func findLongestSubString_NotOptimal(word string) string {
	var longestWord = ""
	for i, _ := range word {
		helper := largeSubstringByIndex_NotOptimal(word, i, longestWord)
		if len(longestWord) < len(helper) {
			longestWord = helper
		}
	}
	return longestWord
}

func isSubstringDistinct(word string, initialIndex int, lastIndex int) bool {
	var booleanArray = make([]bool, 256)
	for i := initialIndex; i <= lastIndex; i++ {
		if booleanArray[int(word[i])] {
			return false
		}
		booleanArray[int(word[i])] = true
	}
	return true
}
func maxSubStringLengthAndSplitWordInSubstrings(word string) int {
	wordSize := len(word)
	maxLength := 0
	for i := 0; i < wordSize; i++ {
		for j := i; j < wordSize; j++ {
			if isSubstringDistinct(word, i, j) && maxLength < j-i+1 {
				maxLength = j - i + 1
			}
		}
	}
	return maxLength
}
